import React from 'react';

const Interests = () => {
    return (
        <div className='interests'>
            <h4>Interests</h4>
            <p>
                Since the 1500s, when an unknown printer took a galley of type and
                scrambled it to make a type specimen book.
        </p>
        </div>
    );
};

export default Interests;
